import CreateTask from './Tasks/CreateTask'

function App() {
  let tasks = [
      {
        title : 'Call to ...',
        done : false
      },
      {
        title : 'Call to ..1',
        done : true
      },
      {
        title : 'Call to ..2',
        done : false
      },
    ]
  function Create(task) {
    tasks.push(task);
    console.log(tasks);
  }

  return (
    <div>
      <CreateTask create = {Create}></CreateTask>
      <div>{tasks[1]}</div>
    </div>

  );
}

export default App;
